import React from 'react'
import MovieList from './../Movies'

export default function Movies(){
    return(
        <div className='mx-auto flex py-20 px-10'>
            <h2>My list</h2>
        {
            MovieList.map((dataList) => {
               return(
                   <div className='inline-block text-center mx-1'>
                       <img 
                            src={dataList.img}
                            className='w-40 h-60'
                            alt=''
                        />
                        <h2 className='text-black z-50 relative top-0 mt-5'>{dataList.title}</h2>
                   </div>

               )
           })
        }
        </div>
    )
}
